import React from 'react'
import { Link, useParams } from 'react-router-dom'
import { getDiary } from '../config/api_functions'
const DiaryDetails = () => {

    const {id}  = useParams()

    const getDiaryDetails = async () =>{
        const diary = await getDiary(id)
        console.log(diary)
    }

    getDiaryDetails()
  return (
    <div>{id}</div>
  )
}

export default DiaryDetails
